Velciet un nometiet failus norādītajā apgabalā vai atlasiet tos tradicionālajā veidā; faili tiks šifrēti un nosūtīti uz serveri. Jūs saņemsiet divas saites uz failu:
Lejupielādes saiti, ko varat kopīgot ar citiem;
un dzēšanas saiti, ar kuru jebkurā laikā varat failu dzēst.
